begin tran 
--select * from Productos

create table #productos_ (idProducto int, descripcion varchar(300), codigoBarras varchar(300), existencia float)



update	Productos
set		Productos.codigoBarras = a.codigoBarras,
		Productos.articulo = a.codigoBarras
from	(
			select idProducto,descripcion,codigoBarras from #productos_ where codigoBarras <> ''
		)A
where	Productos.descripcion collate SQL_Latin1_General_CP1_CI_AS = a.descripcion collate SQL_Latin1_General_CP1_CI_AS





	select	p.idProducto, case when p_.existencia < 0 then 0 else p_.existencia end , getdate() as fechaAlta, 4 as idUbicacion, getdate() as fechaActualizacion
	from	#productos_ p_
				join Productos p 
					on p.descripcion collate SQL_Latin1_General_CP1_CI_AS = p_.descripcion collate SQL_Latin1_General_CP1_CI_AS 
					


	select	p.idProducto,case when p_.existencia < 0 then 0 else p_.existencia end , getdate() as fechaUltimaActualizacion
	from	#productos_ p_
				join Productos p 
					on p.descripcion collate SQL_Latin1_General_CP1_CI_AS = p_.descripcion collate SQL_Latin1_General_CP1_CI_AS 

