delete from InventarioDetalle where idInventarioDetalle in
(
select idInventarioDetalle from InventarioDetalle where idProducto in (
select idProducto from InventarioDetalle where idubicacion = 4 group by idProducto having count(idProducto)>1 
) and idInventarioDetalle >  1069 
)

delete from InventarioGeneral where contador in
(
select contador  from InventarioGeneral where idProducto in (
select idProducto from InventarioGeneral group by idProducto having count(idProducto)>1 
) and contador >  1057 
)

select count(idProducto) ,idProducto from InventarioDetalle where idubicacion = 4 group by idProducto having count(idProducto)>1 
select count(idProducto) ,idProducto from InventarioGeneral group by idProducto having count(idProducto)>1 

